import './ProjectsStyles.css';
import Cards from '../../components/cards/Cards';

function Projects(){
    return(
        <div className='container'>
            <h1 style={{color:"cyan"}}>Projects</h1>
            <div className='cards-co'>
                <Cards />
            </div>
        </div>
    );
}

export default Projects;
